configure:
  commands:
    end:
      new_state: execute
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: PI-9300-Stack-103(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: PI-9300-Stack-103(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    install auto-abort-timer stop:
      response:
      - "install_auto_abort_timer: START Sun Aug  7 12:39:13 UTC 2022\r\nSUCCESS:\
        \ install_auto_abort_timer  Sun Aug  7 12:39:13 UTC 2022"
      response_type: circular
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: PI-9300-Stack-103#
